import React from "react";
import { View, Text, Image, TextInput, TouchableOpacity, FlatList, StyleSheet, ImageBackground } from "react-native";


const cats = [
  { id: "1", name: "Samantha", breed: "British Short Hair", location: "Bogor, Jawa Barat", image: "https://example.com/cat1.jpg" },
  { id: "2", name: "Kelly", breed: "Munchkin", location: "Semarang, Jawa Tengah", image: "https://example.com/cat2.jpg" },
];

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.welcomeText}>Welcome, Emily</Text>
        <Image 
        source={require("../assets/splash.png")}
        style={styles.profileImage} />
      </View>

    <ImageBackground
     source={require("../assets/homebanner.png")}
     style={styles.bannerImage} />
      <TouchableOpacity style={styles.adoptBanner}>
        <Text style={styles.adoptBannerText}>Adopt now! Free Cat Supply!</Text>
      </TouchableOpacity>

      <View style={styles.searchContainer}>
        <TextInput placeholder="Search your cat..." style={styles.searchInput} />
        <TouchableOpacity style={styles.filterButton}>
          <Text style={styles.filterButtonText}>Filter</Text>
        </TouchableOpacity>
      </View>

      <View style={styles.adoptContainer}>
        <Text style={styles.adoptTitle}>Adopt a Cat</Text>
        <FlatList
          data={cats}
          renderItem={({ item }) => (
            <View style={styles.catCard}>
              <Image source={{ uri: item.image }} style={styles.catImage} />
              <Text style={styles.catName}>{item.name}</Text>
              <Text style={styles.catBreed}>{item.breed}</Text>
              <Text style={styles.catLocation}>{item.location}</Text>
            </View>
          )}
          keyExtractor={(item) => item.id}
          horizontal
        />
      </View>

      <View style={styles.footer}>
        <TouchableOpacity>
          <Text style={styles.footerIcon}>üè†</Text>
        </TouchableOpacity>
        <TouchableOpacity>
          <Text style={styles.footerIcon}>üê±</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    backgroundColor: "#f5f5f5",
  },
  header: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    marginTop: 35,
  },
  welcomeText: {
    fontSize: 20,
    fontWeight: "bold",
  },
  profileImage: {
    width: 40,
    height: 40,
    borderRadius: 20,
  },
  adoptBanner: {
    padding: 20,
    borderRadius: 10,
    flexDirection: "row",
    alignItems: "center",
    marginVertical: 20,
  },
  adoptBannerText: {
    color: "#fff",
    fontSize: 18,
    flex: 1,
  },
  bannerImage: {
    width: 50,
    height: 50,
  },
  searchContainer: {
    flexDirection: "row",
    alignItems: "center",
  },
  searchInput: {
    flex: 1,
    padding: 10,
    borderWidth: 1,
    borderColor: "#ccc",
    borderRadius: 10,
  },
  filterButton: {
    marginLeft: 10,
    padding: 10,
    backgroundColor: "#4285F4",
    borderRadius: 10,
  },
  filterButtonText: {
    color: "#fff",
  },
  adoptContainer: {
    flex: 1,
  },
  adoptTitle: {
    fontSize: 18,
    fontWeight: "bold",
    marginBottom: 10,
  },
  catCard: {
    backgroundColor: "#fff",
    padding: 10,
    borderRadius: 10,
    marginRight: 10,
    alignItems: "center",
  },
  catImage: {
    width: 100,
    height: 100,
    borderRadius: 10,
  },
  catName: {
    fontSize: 16,
    fontWeight: "bold",
    marginTop: 10,
  },
  catBreed: {
    fontSize: 14,
    color: "#666",
  },
  catLocation: {
    fontSize: 12,
    color: "#aaa",
  },
  footer: {
    flexDirection: "row",
    justifyContent: "space-around",
    paddingVertical: 10,
    backgroundColor: "#fff",
    borderRadius: 10,
    shadowOpacity: 1,
  },
  footerIcon: {
    fontSize: 24,
  },
});
